import 'bootstrap/dist/css/bootstrap.min.css';
import './login/style.scss'; // Import your custom CSS

function JobListing() {
  const [job, setJob] = useState({ title: '', description: '' });

  const handleChange = (e) => {
    setJob({ ...job, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Call API to save job listing
  };

  return (
    <div className="container my-5">
      <div className="row mb-4">
        <div className="col">
          <input type="text" className="form-control" placeholder="Search Job Listings" />
        </div>
      </div>
      <div class="card my-4"  >
        <img style={{ width: 30 ,height:30}} src={require("../assets/images/user.png")} class="card-img-top" alt="..." />
        <div class="card-body">
          <h5 class="card-title">Card title</h5>
          <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
          <a href="#" class="btn btn-primary">Go somewhere</a>
        </div>
      </div>
    </div>
  );
}

export default JobListing;
